import Link from "next/link";
import Layout from '../components/Layout';
import Question from '../static/Question';
import Choice from '../static/Choice';
import { Component } from "react";
import json_data from '../static/question_set.json'

class Main extends Component{

    constructor(props){
        super(props);
        this.question = json_data;
        console.log(this.question);
    }

    render(){
        return(
            <Layout>
                <div className="main-screen">
                   <div className="question_box">
                       <Question q_sentence={this.question[0].q_sentence} />
                   </div>
                   <div className="choice_box">
                       <Choice options={this.question[0].options} />
                   </div>
                   <div className="ans_btn">回答</div>
               </div>
           </Layout>
        )
    }
}

export default Main;
